import { Route, Router } from 'react-router-dom';
import './App.css';
import Blogs from './components/Blogs/Blogs';
import Body from './components/Body/Body';
import Header from './components/Header/Header';

function App() {
  return (
    <div className="App">
      <Header></Header>
      <Router>
        <Route path="/" element={<Blogs></Blogs>} />
      </Router>
      <Body></Body>
    </div>
  );
}

export default App;
